import React, { useState } from 'react';
import './SignUpBox.css';
//import axios from 'axios';
//import {BASE_url}from '../Constants/Constants';
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBCheckbox,
  MDBIcon
}
from 'mdb-react-ui-kit';

const SignUpBox = ({setBoxName})=> {
  const handleLogin=()=>{
    setBoxName('login')
}
const [signUpData,setsignUpDAta]=useState(
  {
    fName:'',
    lName:'',
    email:'',
    password:'',
    confirmPassword:''
    })
  
 const [name, setName] = useState('');
 const [email, setEmail] = useState('');
 const [password, setPassword] = useState('');
 const [error, setError] = useState('');
 /*const handleRegister=()=>{
  try{
    axios.post(`${BASE_url}/auth/signup`,signUpData).then((res)=>{
      if(res.data.message==="signup success"){
        setBoxName('login')
    

      }
      if(res.data.message==="email already exist"){
        alert('already exist')
      }
    })

  }catch(error){

  }
 }

 const validate = () => {
    if (!name || !email || !password) {
      setError('Please fill out all fields');
      return false;
    }

    if (password.length < 6) {
      setError('Password should be at least 6 characters long');
      return false;
    }

    setError('');
    return true;
 };

 const handleSubmit = (e) => {
    e.preventDefault();

    if (validate()) {
      // submit form
      console.log('Form submitted:', { name, email, password });
    }
 };*/

 return (<>
   /* <>
   <div className='container col-5'>
    <form className="signup-form" onSubmit={handleSubmit}>
      <h2>Sign Up</h2>
      <input
        type="text"
        placeholder="Name"
        value={name}
        onChange={(e) => setName(e.target.value)}
      />
      <input
        type="email"
        placeholder="Email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
      />
      <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      {error && <p className="error">{error}</p>}
      <button type="submit">Sign Up</button>
      <div className='click'>
<p><span onClick={handleLogin}>go to login</span> </p>
      </div>
    </form></div>
    </>
 );*/       
  <MDBCol md='6' className='position-relative'>

 <MDBCard className='my-5 bg-glass'>
 <MDBCardBody className='p-5'>

   <MDBRow>
     <MDBCol col='6'>
       <MDBInput wrapperClass='mb-4' label='First name' id='form1' type='text' value={signUpData.fName} onChange={()=>{setsignUpDAta({fName })}}/>
       
     </MDBCol>

     <MDBCol col='6'>
       <MDBInput wrapperClass='mb-4' label='Last name' id='form2' type='text'/>
     </MDBCol>
   </MDBRow>

   <MDBInput wrapperClass='mb-4' label='Email' id='form3' type='email'/>
   <MDBInput wrapperClass='mb-4' label='Password' id='form4' type='password'/>

   <div className='d-flex justify-content-center mb-4'>
     <MDBCheckbox name='flexCheck' value='' id='flexCheckDefault' label='Subscribe to our newsletter' />
   </div>

   <MDBBtn className='w-100 mb-4' size='md'>sign up</MDBBtn>

   <div className="text-center">

     <p>or sign up with:</p>

     <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
       <MDBIcon fab icon='facebook-f' size="sm"/>
     </MDBBtn>

     <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
       <MDBIcon fab icon='twitter' size="sm"/>
     </MDBBtn>

     <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
       <MDBIcon fab icon='google' size="sm"/>
     </MDBBtn>

     <MDBBtn tag='a' color='none' className='mx-3' style={{ color: '#1266f1' }}>
       <MDBIcon fab icon='github' size="sm"/>
     </MDBBtn>

   </div>

 </MDBCardBody>
</MDBCard>

</MDBCol>
</>)
}
export default SignUpBox;
